void Map::LoadMap1(std::string path, int x, int y)
{
    char tile;
    std::fstream mapFile;
    mapFile.open(path);
    mapFile.close();
    for (int i = 0; i < y; i++)
    {
        for (int j = 0; j < x; j++)
        {
            mapFile.get(tile);
            std::cout<<tile<<std::endl;
            Game::AddTile(atoi(&tile) ,x*32 , y*32  );
            mapFile.ignore();

        }
    }
}
